import Layout from '../components/Layout';

const Contact = () => (
  <Layout>
    <div>
      <h1>Contact</h1>
      <p>Nayab Lone 
         <br/> Email Nayab.Lone@hyperisland.se
          <br/>Phone : 0738236700
          <br/>Facebook: Ryangigs
          
      </p>
    </div>
  </Layout>
);

export default Contact;
